function User(props){
  return(
    <div className="usermain">
      <h2>Name : {props.name}</h2>
      <h2>ID : {props.id}</h2>
      <h2>Email : {props.email}</h2>
    </div>
  );
}

function UserList(){
  return(
      users.map((user, index)=>{
        return <User {...user} />
      })
  );
}

ReactDOM.render(<UserList />, document.getElementById('root'));
